import '../App.css'
import '../bootstrap.min.css'
import React, { useState } from "react";

function Album(props) {
    return (
        <div className={"floatin"}>
            <img className={"album"} src={"./dark.jpg"}/>
            <span className={"text-white titulo"}>
                <div>me here</div>
            </span>
            <span>me too</span>

        </div>
    );
}

export default Album
